        padding: "10px",
        fontFamily: "Merriweather",
        textAlign: "center",
        // textTransform: "uppercase",
      };
      return (
        <div>
        <h1 style={mystyle}>Hello!</h1>
        <p>Add a little style!</p>
        </div>
      );
    }
  }

export default withStyles(Home);
